import React from 'react';

import '../Toolbar/Toolbar.css';
import Logo from '../../UI/Logo/Logo';
import NavigationItems from '../NavigationItems/NavigationItems';

const toolbar = (props) => (
    <header className='Toolbar'>
        <div>MENU</div>
        <Logo height="80%"/>
        <nav>
            <NavigationItems/>
        </nav>
    </header>
);

export default toolbar;
